    true,nt"url": null,nt"notes": "2000-2010 Annual State-Scale Service and
    Domain scores used to support the approach for forecasting EPA's Human Well-Being
    Index. A modeling approach was developed based relationship function equations derived
    from select economic, social and ecosystem final goods and service scores and calculated
    human well-being index and related domain scores. These data are being used in a
    secondary capacity. The foundational data and scoring techniques were originally
    described in: a) U.S. EPA. 2012. Indicators and Methods for Constructing a U.S.
    Human Well-being Index (HWBI) for Ecosystem Services Research. Report. EPA/600/R-12/023.
    pp. 121; and b) U.S. EPA. 2014. Indicators and Methods for Evaluating Economic,
    Ecosystem and Social Services Provisioning. Report. EPA/600/R-14/184. pp. 174. Mode
    Smith, L. M., Harwell, L. C., Summers, J. K., Smith, H. M., Wade, C. M., Straub,
    K. R. and J.L. Case (2014).nnnThis dataset is associated with the following publication:nSummers
    , K., L. Harwell , and L. Smith. A Model For Change: An Approach for Forecasting
    Well-Being From Service-Based Decisions.   ECOLOGICAL INDICATORS. Elsevier Science
